import "../chunk-VBXJIVYU.js";

// src/validators/recorder.validators.ts
import { z } from "zod";
var getRecordingsInputSchema = z.object({
  limit: z.number().min(1).max(20).optional(),
  cursor: z.number().optional()
});
var apiKeyRecordingDataSchema = z.object({
  id: z.string(),
  recordingUrl: z.string(),
  recordingSize: z.number()
});
var apiKeyRecordingsSchema = z.object({
  nextCursor: z.number().nullable(),
  recordings: z.array(apiKeyRecordingDataSchema)
});
export {
  apiKeyRecordingsSchema,
  getRecordingsInputSchema
};
